import { Component } from '@angular/core';

@Component({
  selector: 'app-home-driver',
  templateUrl: './home-driver.component.html',
  styleUrls: ['./home-driver.component.css']
})
export class HomeDriverComponent {
  title = 'Web Driver';

}
